import React from 'react';
import Product from '../Components/Product.json';

function ProductItems(props) {
    return (
        <div>
            <h3>{props.Product.title}</h3>
            <h4>{props.Product.Price}</h4>
            <p>{props.Product.description}</p>
        </div>
    )
}

export default ProductItems;
